'use client';

import React, { useState } from 'react';
import {
  Box,
  Typography,
  TextField,
  Button,
  Paper,
  MenuItem,
  Snackbar,
  Alert,
  InputAdornment
} from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import EmailIcon from '@mui/icons-material/Email';
import MiscellaneousServicesIcon from '@mui/icons-material/MiscellaneousServices';
import MessageIcon from '@mui/icons-material/Message';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';

const tiposServicio = [
  'Cotización agrícola',
  'Consulta veterinaria',
  'Laboratorio técnico',
  'Soporte rural',
  'Rastreo de pedido'
];

export default function FormularioServicio() {
  const [formData, setFormData] = useState({
    nombre: '',
    email: '',
    tipo: '',
    mensaje: ''
  });

  const [errors, setErrors] = useState({});
  const [openSnackbar, setOpenSnackbar] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
    setErrors((prev) => ({ ...prev, [name]: '' }));
  };

  const validarFormulario = () => {
    const newErrors = {};
    if (!formData.nombre.trim()) newErrors.nombre = 'Nombre requerido';
    if (!formData.email.trim()) {
      newErrors.email = 'Correo requerido';
    } else if (!/^[\w-.]+@([\w-]+\.)+[\w-]{2,4}$/.test(formData.email)) {
      newErrors.email = 'Correo no válido';
    }
    if (!formData.tipo) newErrors.tipo = 'Selecciona un servicio';
    if (!formData.mensaje.trim()) newErrors.mensaje = 'Mensaje requerido';
    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validarFormulario()) {
      console.log('Solicitud enviada:', formData);
      setOpenSnackbar(true);
      setFormData({
        nombre: '',
        email: '',
        tipo: '',
        mensaje: ''
      });
    }
  };

  return (
    <Box sx={{ pt: 10, px: { xs: 2, md: 4 }, pb: 6, bgcolor: '#f5f5f5', minHeight: '100vh' }}>
      <Typography variant="h4" sx={{ fontWeight: 'bold', textAlign: 'center', color: '#2e7d32', mb: 4 }}>
        ✍️ Solicitud de Servicio en Línea
      </Typography>

      <Paper elevation={5} sx={{ p: 4, borderRadius: 4, maxWidth: 600, mx: 'auto' }}>
        <form onSubmit={handleSubmit}>
          <TextField
            label="Nombre completo"
            name="nombre"
            fullWidth
            required
            value={formData.nombre}
            onChange={handleChange}
            error={!!errors.nombre}
            helperText={errors.nombre}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <PersonIcon color="action" />
                </InputAdornment>
              )
            }}
            sx={{ mb: 3 }}
          />
          <TextField
            label="Correo electrónico"
            name="email"
            type="email"
            fullWidth
            required
            value={formData.email}
            onChange={handleChange}
            error={!!errors.email}
            helperText={errors.email}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <EmailIcon color="action" />
                </InputAdornment>
              )
            }}
            sx={{ mb: 3 }}
          />
          <TextField
            label="Tipo de servicio"
            name="tipo"
            select
            fullWidth
            required
            value={formData.tipo}
            onChange={handleChange}
            error={!!errors.tipo}
            helperText={errors.tipo}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <MiscellaneousServicesIcon color="action" />
                </InputAdornment>
              )
            }}
            sx={{ mb: 3 }}
          >
            {tiposServicio.map((tipo, idx) => (
              <MenuItem key={idx} value={tipo}>
                {tipo}
              </MenuItem>
            ))}
          </TextField>
          <TextField
            label="Mensaje o detalle del servicio"
            name="mensaje"
            multiline
            rows={4}
            fullWidth
            required
            value={formData.mensaje}
            onChange={handleChange}
            error={!!errors.mensaje}
            helperText={errors.mensaje}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <MessageIcon color="action" />
                </InputAdornment>
              )
            }}
            sx={{ mb: 3 }}
          />
          <Button
            variant="contained"
            type="submit"
            fullWidth
            sx={{
              bgcolor: '#2e7d32',
              '&:hover': { bgcolor: '#1b5e20' },
              textTransform: 'none',
              fontWeight: 'bold',
              fontSize: '16px',
              py: 1.5
            }}
            startIcon={<CheckCircleIcon />}
          >
            Enviar solicitud
          </Button>
        </form>
      </Paper>

      <Snackbar
        open={openSnackbar}
        autoHideDuration={4000}
        onClose={() => setOpenSnackbar(false)}
        anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
      >
        <Alert severity="success" sx={{ width: '100%' }}>
          ✅ Solicitud enviada correctamente
        </Alert>
      </Snackbar>
    </Box>
  );
}
